import React from "react";
import { link } from "react-router-dom";

const Navbar = () =>{
    return(
        <>
           <header>
            <nav>
                <link to='/'>Contact Us</link>
                <link to='/contact'>Contact Us</link>
                <link to='/contact/name'>Contact Us</link>
            </nav>
           </header>

        </>
    )
}
export default Navbar;
